import React from "react";
import { Container, Button } from "@material-ui/core";

class MainPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      page: "welcome",
    };
  }
  gerPage = () => {};

  render() {
    return (
      <Container>
        <div
          style={{
            textAlign: "center",
            position: "relative",
            marginTop: "20%",
          }}
        >
          <h1>Here is the main page of Facial testing</h1>
        </div>
      </Container>
    );
  }
}

export default MainPage;
